import React from 'react';
import Credential from './components/atoms/Credential/Credential';
import { useState } from 'react';


function App() {
  const [value, setValue] = useState('')
  function getValue(value) {
    setValue(value)
  }
  return (
    <div>
      <Credential getValue={getValue} placeHolder={"Account"}/>
      <p>thats the value: {value}</p>
    </div>
  );
}

export default App;
